function Winner({ winningColor, winnerClicked, startGame }) {

    return (
    <>
      <div id="item-6">

        {!winnerClicked ? `        Find This Color: rgb (${winningColor.red}, ${winningColor.green},
        ${winningColor.blue})` : <button onClick={startGame}>Restart Game</button>}
      </div>
    </>
  );
}

export default Winner;
